        (((C_INCLUDE_CPLL_CAL       == `rp_gt_gtwizard_gthe3_INCLUDE_CPLL_CAL__DEPENDENT) &&
         ((C_GT_REV                 == 11) ||
          (C_GT_REV                 == 14))) &&
