      else if (C_TX_USER_CLOCKING_INSTANCE_CTRL == `rp_gt_gtwizard_gthe3_TX_USER_CLOCKING_INSTANCE_CTRL__PER_CHANNEL)
      begin : gen_per_channel_instance

