`timescale 1ps/1ps

module gtwizard_ultrascale_v1_5_4_gthe3_cpll_cal_rp # (
        parameter REVISION = 2
)(
        // control signals
        input wire  [17:0] TXOUTCLK_PERIOD_IN,
        input wire  [15:0] WAIT_DEASSERT_CPLLPD_IN,
        input wire  [17:0] CNT_TOL_IN,
